import { Component, OnInit } from '@angular/core';

import { SocketService } from '../../service/sockets/socket.service';

import { ClientesService } from "../../service/clientes/clientes.service";

import Swal from 'sweetalert2';


import { NuevoCliente, EditCliente } from "../../models/clientes.models";

declare let $: any;

@Component({
  selector: 'app-clientes',
  templateUrl: './clientes.component.html',
  styleUrls: ['./clientes.component.css'],
  providers: [ClientesService]

})

export class ClientesComponent implements OnInit {

  public clientes: any = [];
  public nuevoCliente: any
  public message: any;
  public messageEdit: any;
  public editCliente: any;
  public municipios: any = [];

  constructor(private _serviceClientes: ClientesService) {
    this.nuevoCliente = new NuevoCliente('', '', '', '', '');
    this.editCliente = new EditCliente('', '', '', '', '', '')
  }

  ngOnInit(): void {

    this.getClientes();
    this.event();
    this.WindowsOnLoad();
  }

  ngOnDestroy(): void {

    /*  this.socket.disconnect(); */

  }


  WindowsOnLoad() {
    $('#selectciudad').select2(
      {
        dropdownParent: $('#exampleModal')
      }
    )
  }

  getClientes() {
    this._serviceClientes.getClientes().subscribe((res: any) => {

      if (res.status === 200) {
        this.clientes = res.body;
      }
    },
      (error) => {
        var errorMessage = <any>error;

        if (errorMessage != null) {
          var body = error.error;

          if (error.status === 401) {
            this.message = body.body.message
          }

          if (error.status === 404) {
            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px',
            });

            Toast.fire({
              icon: 'info',
              title: body.body.message,
            });

          }
          if (error.status === 500) {
            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px',
            });

            Toast.fire({
              icon: 'error',
              title: body.body.message,
            });

          }
          if (error.status === 0) {
            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px',
            });

            Toast.fire({
              icon: 'error',
              title: 'Por favor compruebe su conexión de internet',
            });
          }
        }
      }

    );
  }

  async event() {


  }

  addCliente() {

    this._serviceClientes.addCliente(this.nuevoCliente).subscribe((res: any) => {

      if (res.status === 200) {
        Swal.fire({
          title: '¡El cliente se ha guardado correctamente!',
          icon: 'success',
          confirmButtonText: 'Cerrar',
        });

        let element: HTMLElement = document.getElementsByClassName(
          'btn-close-add'
        )[0] as HTMLElement;
        element.click();

        this.getClientes();
        this.nuevoCliente = new NuevoCliente('', '', '', '', '')

        this.message = false
      }


    }, error => {
      var errorMessage = <any>error;

      if (errorMessage != null) {
        var body = error.error

        if (error.status === 404) {
          Swal.fire({
            title: body.body.message,
            icon: 'warning',
            confirmButtonText: 'Cerrar',
          });

        }

        if (error.status === 401) {
          this.message = body.body.message;
        }

        if (error.status == 500) {

          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: body.body.message

          })

        }
        if (error.status == 0) {
          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: 'Por favor compruebe su conexión de internet'

          })
        }
      }
    })
  }

  getCliente(id: string) {

    this._serviceClientes.getCliente(id).subscribe((res: any) => {

      if (res.status === 200) {
        this.editCliente = res.body[0]
      }
    }, error => {
      var errorMessage = <any>error;

      if (errorMessage != null) {
        var body = error.error

        if (error.status === 404) {
          Swal.fire({
            title: body.body.message,
            icon: 'warning',
            confirmButtonText: 'Cerrar',
          });

        }

        if (error.status == 500) {

          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: body.body.message

          })

        }
        if (error.status == 0) {
          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: 'Por favor compruebe su conexión de internet'

          })
        }
      }
    })

  }

  deleteCliente(id: string) {
    Swal.fire({

      title: "¿Está seguro de eliminar el cliente?",
      text: "¡Si no lo está puede cancelar la accíon!",
      icon: "warning",
      showCancelButton: true,
      confirmButtonColor: '#3085d6',
      cancelButtonColor: '#d33',
      cancelButtonText: 'Cancelar',
      confirmButtonText: 'Si, eliminar cliente!'
    }).then((result) => {

      if (result.value) {
        this._serviceClientes.deleteCliente(id).subscribe((res: any) => {

          if (res.status === 200) {
            Swal.fire({
              title: '¡El cliente se ha eliminado correctamente!',
              icon: 'success',
              confirmButtonText: 'Cerrar',
            });
            this.getClientes();
          }

          if (res.status === 404) {
            Swal.fire({
              title: res.body.message,
              icon: 'warning',
              confirmButtonText: 'Cerrar',
            });

          }

          if (res === 500) {
            Swal.fire({
              title: res.body.message,
              icon: 'error',
              confirmButtonText: 'Cerrar',
            });
          }

        })
      }
    })
  }

  updateCliente() {

    this._serviceClientes.editCliente(this.editCliente).subscribe((res: any) => {
      if (res.status === 200) {
        Swal.fire({
          title: '¡El cliente se modifico correctamente!',
          icon: 'success',
          confirmButtonText: 'Cerrar',
        });

        let element: HTMLElement = document.getElementsByClassName(
          'btn-close-edit'
        )[0] as HTMLElement;
        element.click();

        this.getClientes();

        this.editCliente = new EditCliente('', '', '', '', '', '')

        this.messageEdit = false;

      }

    }, error => {
      var errorMessage = <any>error;

      if (errorMessage != null) {
        var body = error.error

        if (error.status == 401) {
          console.log(body.body.message)
          this.messageEdit = body.body.message
        }

        if (error.status === 404) {
          Swal.fire({
            title: body.body.message,
            icon: 'warning',
            confirmButtonText: 'Cerrar',
          });

        }

        if (error.status == 500) {

          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: body.body.message

          })

        }
        if (error.status == 0) {
          const Toast = Swal.mixin({
            toast: true,
            position: 'center',
            showConfirmButton: false,
            timer: 4000,
            timerProgressBar: true,
            width: '300px'
          })

          Toast.fire({
            icon: 'error',
            title: 'Por favor compruebe su conexión de internet'

          })
        }
      }
    })
  }

